

/*** cnvyr.min.js ***/
tinymce.PluginManager.add("jbimages",function(c,b){function a(){c.windowManager.open({title:"Upload an image",file:c.getParam("uploadUrl"),width:350,height:135,buttons:[{text:"Close",onclick:"close"}]})}c.addButton("jbimages",{tooltip:"Upload an image",icon:"image",text:"Upload",onclick:a});c.addMenuItem("jbimages",{text:"Upload image",icon:"image",context:"insert",onclick:a})});